import React, { useState } from "react";
import TextField from "@mui/material/TextField";
import Autocomplete from "@mui/material/Autocomplete";
import AdapterDateFns from "@mui/lab/AdapterDateFns";
import LocalizationProvider from "@mui/lab/LocalizationProvider";
import Box from "@mui/material/Box";
import DateRangePicker from "@mui/lab/DateRangePicker";
import { useNavigate } from "react-router-dom";

function Dashboard() {
  let navigate = useNavigate();
  const city = [
    
  ];

  let select = [
    {
      label: "Hourly/Daily",
    },
    {
      label: "30 Day Booking",
    },
  ];

  const [value, setValue] = React.useState([null, null]);

  let products = [
    {
      label: "Camera",
    },
    {
      label: "EV Bike",
    },
    {
      label: "Bicycle",
    },
    {
      label: "Tripad",
    },
    {
      label: "Atomos Shogun Monitor",
    },
  ];

  // let handlesubmit = () => {
  //   if (TextField.params === products[0]) {
  //     console.log("Hy");
  //   }
  // }
  const [selectedOptions, setSelectedOptions] = useState([]);
  const handleChange = (event, value) => setSelectedOptions(value);

  const handleSubmit = () => {
    if (selectedOptions.label === "Camera") {
      navigate("/camera");
    } else if (selectedOptions.label === "EV Bike") {
      navigate("/ev-bike");
    } else if (selectedOptions.label === "Bicycle") {
      navigate("/bicycle");
    } else if (selectedOptions.label === "Tripad") {
      navigate("/tripad");
    } else if (selectedOptions.label === "Atomos Shogun Monitor") {
      navigate("/atmos-shougn-monitor");
    }
  };

  return (
    <div>
      <div className="text-center" style={{ marginTop: "250px" }}>
        <h1>RENT TODAY, OWN TOMMOROW</h1>
        <div className="grid bg-white container mt-5">
          <Autocomplete
            className="m-auto"
            id="country-select-demo"
            sx={{ width: 300 }}
            options={city}
            autoHighlight
            getOptionLabel={(option) => option.label}
            renderOption={(props, option) => (
              <Box
                component="li"
                sx={{ "& > img": { mr: 2, flexShrink: 0 } }}
                {...props}
              >
                <img
                  loading="lazy"
                  width="20"
                  src={`https://flagcdn.com/w20/${option.code.toLowerCase()}.png`}
                  srcSet={`https://flagcdn.com/w40/${option.code.toLowerCase()}.png 2x`}
                  alt=""
                />
                {option.label} ({option.code}) +{option.phone}
              </Box>
            )}
            renderInput={(params) => (
              <TextField
                className="pr-2 pl-2"
                {...params}
                label="Select City"
                inputProps={{
                  ...params.inputProps,
                  autoComplete: "new-password", // disable autocomplete and autofill
                }}
              />
            )}
          />
          <Autocomplete
            disablePortal
            id="combo-box-demo"
            options={select}
            sx={{ width: 300 }}
            renderInput={(params) => (
              <TextField {...params} label="Hourly / Daily" />
            )}
          />
          <LocalizationProvider dateAdapter={AdapterDateFns}>
            <DateRangePicker
              startText="Check-in"
              endText="Check-out"
              value={value}
              onChange={(newValue) => {
                setValue(newValue);
              }}
              renderInput={(startProps, endProps) => (
                <React.Fragment>
                  <TextField {...startProps} />
                  <Box sx={{ mx: 2 }}> to </Box>
                  <TextField {...endProps} />
                </React.Fragment>
              )}
            />
          </LocalizationProvider>
          <Autocomplete
            autoHighlight
            className="ml-4"
            disablePortal
            id="combo-box-demo"
            options={products}
            onChange={handleChange}
            // filterSelectedOptions
            sx={{ width: 300 }}
            renderInput={(params) => <TextField {...params} label="Products" />}
          />
        </div>
        <button
          className="btn btn-primary m-auto mt-5"
          style={{ width: "200px" }}
          onClick={() => handleSubmit()}
        >
          Book Now
        </button>
      </div>
    </div>
  );
}

export default Dashboard;
